<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Pericardial Effusion Infographic</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;600;700&display=swap" rel="stylesheet">
    <script src="https://cdn.tailwindcss.com"></script>
    <script>
        tailwind.config = {
            theme: {
                extend: {
                    colors: {
                        'primary-bg': '#F8F8F8', // Soft off-white background
                        'primary-text': '#333333', // Dark, highly readable text
                        'accent-blue': '#6082B6', // Soft, calming blue for title
                    },
                    fontFamily: {
                        sans: ['Inter', 'sans-serif'],
                        display: ['Inter', 'sans-serif'], // For headings
                        body: ['Inter', 'sans-serif'], // For body text
                    },
                    animation: {
                        'fade-in-up': 'fadeInUp 0.8s ease-out forwards',
                        'scale-in': 'scaleIn 0.5s ease-out forwards',
                    },
                    keyframes: {
                        fadeInUp: {
                            '0%': { opacity: '0', transform: 'translateY(20px)' },
                            '100%': { opacity: '1', transform: 'translateY(0)' },
                        },
                        scaleIn: {
                            '0%': { transform: 'scale(0.95)', opacity: '0.8' },
                            '100%': { transform: 'scale(1)', opacity: '1' },
                        },
                    },
                },
            }
        }
    </script>
    <style>
        /* Custom scrollbar for a sleek look */
        ::-webkit-scrollbar {
            width: 8px;
        }
        ::-webkit-scrollbar-track {
            background: #e0e0e0;
            border-radius: 10px;
        }
        ::-webkit-scrollbar-thumb {
            background: #a0a0a0;
            border-radius: 10px;
        }
        ::-webkit-scrollbar-thumb:hover {
            background: #888;
        }

        /* Base styles */
        body {
            font-family: 'Inter', sans-serif;
            color: var(--tw-colors-primary-text);
            background-color: var(--tw-colors-primary-bg);
            display: flex;
            justify-content: center;
            align-items: flex-start; /* Align items to the start vertically, allowing scroll */
            min-height: 100vh;
            padding: 2rem 1rem;
            box-sizing: border-box;
            overflow-y: auto; /* Enable scrolling for content overflow */
        }

        /* Specific styles for the infographic to prevent too much vertical shrinkage on large screens */
        .infographic-container {
            max-width: 1200px; /* Max width for the entire content block */
            width: 100%;
            padding: 2rem;
            border-radius: 1rem;
            background: white;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.08), 0 4px 12px rgba(0, 0, 0, 0.05);
            animation: fadeInUp 0.8s ease-out forwards;
            display: flex;
            flex-direction: column;
            align-items: center;
            text-align: center;
        }

        .infographic-image {
            display: block;
            max-width: 100%;
            height: auto;
            border-radius: 0.75rem;
            margin-top: 1.5rem;
            box-shadow: 0 4px 15px rgba(0, 0, 0, 0.1);
            animation: scaleIn 0.5s ease-out forwards;
            transition: transform 0.3s ease-in-out;
        }

        .infographic-image:hover {
            transform: scale(1.01);
        }

        @media (max-width: 768px) {
            .infographic-container {
                padding: 1rem;
                border-radius: 0.75rem;
            }
            h1 {
                font-size: 2.25rem !important; /* Adjust H1 size for mobile */
            }
            body {
                padding: 1rem 0.5rem;
            }
        }
    </style>
</head>
